import styles from "./ticketBox.module.css"

export default function ticketBox({name,location,time}){
    return (
        <div className={styles.ticketBox}>
            <img src="" alt="Thumbnail" />
            <div>{name}</div>
            <div>Dia diem</div>
            <div>Thoi gian</div>
            <button>Chi tiet</button>


        </div>
    )
}
